import { Page, Layout, TextStyle } from '@shopify/polaris';

const Index = () => (
    <Page>
      <Layout>
        <TextStyle variation="positive">
        Hola desde mi app con React y Next.js
        </TextStyle>
      </Layout>
    </Page>
    
  );
  
  export default Index;
